export default async function getAllFormIdElements(r){try{if("string"==typeof r&&!(r=document.getElementById(r)))throw new Error(`No form found with id: ${r}.`);if(!(r instanceof HTMLElement))throw new Error("The form parameter must be a string (id) or an HTMLElement.");return Array.from(r.querySelectorAll("[id]")).reduce(((r,e)=>(r[e.id]=e,r)),{})}catch(r){const{default:e}=await import('../error-messages/errorLogs.js"');throw await e("getAllFormIdElementsError","Get all form id elements error: ",r),r}}